import React from 'react';
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
} from 'react-router-dom';

import App from './App';

export default function GetApp() {
    return (
    <Router>
        <Link to='/app'><App /></Link>
    </Router>
        )
}
